import { useState } from "react";
import { Container, Row, Col } from "react-bootstrap";

const Address = () => {
  const [title, setTitle] = useState("");

  return (
    <div className="address">
      <Container>
        <Row>
          <Col>
            <h2 className="bold">Find out if the salad bowl delivers to:</h2>
            <form>
              <label></label>
              <input
                type="text"
                required
                value={title}
                onChange={(e) => setTitle(e.target.value)}
              />
              <br></br>
              <button href="address">Continue</button> <p>{title}</p>
            </form>
          </Col>
          <Col></Col>
          <Col></Col>
        </Row>
      </Container>
    </div>
  );
};

export default Address;
